            consequuntur, deserunt eaque error nulla temporibus!"
              footer="This is standard card footer"
            />
            {/* <div className="container"> */}

          <table id="example" class="display">
            <thead>
                <tr>
                    <th>유저ID</th>
                    <th>이메일</th>
                    <th>카카오닉네임</th>
                    <th>홈닉네임</th>
                    <th>핸드폰</th>
                    <th>가입일</th>
                    <th>구독</th>
                    <th>차단</th>
                    <th>수정</th>
                    <th>삭제</th>
                </tr>
            </thead>
            <tbody>

                <tr>
                    <td>Tiger Nixon</td>
                    <td>System Architect</td>
                    <td>Edinburgh</td>
                    <td>61</td>
                    <td>2011/04/25</td>
                    <td>$320,800</td>
                    <td>2011/04/25</td>
                    <td>$320,800</td>
                    <td>2011/04/25</td>
                    <td>$320,800</td>
                </tr>
              {
                userlist.map(function(data){
                return(
                  <tr>
                      <td>{data['userid']}</td>
                      <td>{data['email']}</td>
                      <td>{data['kakaoname']}</td>
                      <td>{data['nickname']}</td>
                      <td>{data['phone']}</td>
                      <td>{data['userdate'].substring(0,19)}</td>
                      <td>{data['subscripstat'] === 1 ? "구독" : "-" }</td>
                      <td>{data['managestat']  === 1 ? "차단" : "-" }</td>
                      <td> 수정 </td>
                      <td> 삭제 </td>
                  </tr>
                        )
                      })
              }

            </tbody>
            <tfoot>
                <tr>
                  <th>유저ID</th>
                    <th>이메일</th>
                    <th>카카오닉네임</th>
                    <th>홈닉네임</th>
                    <th>핸드폰</th>
                    <th>가입일</th>
                    <th>구독</th>
                    <th>차단</th>
                    <th>수정</th>
                    <th>삭제</th>
                </tr>
            </tfoot>
        </table>

        {/* </div> */}

          </Grid.Col>
          {/* <Grid.Col md={6} xl={4}>
            <Card
              title="Built card"
              isCollapsible
              isClosable
              body="Lorem ipsum dolor sit amet, consectetur adipisicing elit.
            Aperiam deleniti fugit incidunt, iste, itaque minima neque
            pariatur perferendis sed suscipit velit vitae voluptatem. A
            consequuntur, deserunt eaque error nulla temporibus!"
            />
          </Grid.Col>
          <Grid.Col md={6} xl={4}>
            <Card
              title="Card blue"
              isCollapsible
              isClosable
              statusColor="blue"
              body="Lorem ipsum dolor sit amet, consectetur adipisicing elit.
            Aperiam deleniti fugit incidunt, iste, itaque minima neque
            pariatur perferendis sed suscipit velit vitae voluptatem. A
            consequuntur, deserunt eaque error nulla temporibus!"
            />
        	</Grid.Col> */}
        </Grid.Row>
      </Page.Content>
    </SiteWrapper>
  );
}

export default UserListPage;
